def suffixArray2Partial (suffix_array, k = 1):

    part_arr = {}
    for i, sa in enumerate (suffix_array):
        if sa % k == 0:
            part_arr[i] = sa

    return part_arr

def checkPointArray (last_column, suffix, first_occurance, k=0):

    text_len = len (last_column)

    num_of_chars = len (first_occurance)

    chr_arr = sorted(first_occurance)
    count_tbl = np.zeros ([text_len,num_of_chars], dtype=int)

    for i, ch in enumerate (last_column):
        chr_col = chr_arr.index (ch) #chr_index[ch]
        chr_row = i
        count_tbl[chr_row][chr_col] += 1
        count_tbl[chr_row] = count_tbl[chr_row] + count_tbl[chr_row-1]

    return count_tbl

